public class Solution {
    public int FindMinimumOperations(string s1, string s2, string s3) {
        // Find the shortest length among the three strings, as this will be the maximum possible length they can all be equal to.
        int minLength = Math.Min(s1.Length, Math.Min(s2.Length, s3.Length));

        // Iterate from the end of the strings towards the beginning, to check if they can be made equal.
        for (int i = minLength; i > 0; i--) {
            // Extract the substring of length i from all three strings, starting from index 0.
            string sub1 = s1.Substring(0, i);
            string sub2 = s2.Substring(0, i);
            string sub3 = s3.Substring(0, i);

            // Check if the substrings are equal.
            if (sub1 == sub2 && sub2 == sub3) {
                // Calculate the total number of operations required to make all strings of length i.
                return (s1.Length - i) + (s2.Length - i) + (s3.Length - i);
            }
        }

        // If the loop completes without finding equal substrings, it's not possible to make the strings equal.
        return -1;
    }
}
